import com.nokia.compiler.ExternalScalaFileHelper
import org.scalatest.FlatSpec

import scala.tools.reflect.ToolBoxError


class ExternalParserTest extends FlatSpec{
  val file = ""

  "ExternalParser" should "parse the valid scala code" in {
    val code= ""

    val result = new ExternalScalaFileHelper().processExternalFile(code,file)
    println(result)
    assert(!result.isEmpty)
  }

  it should "throw error if invalid scala code" in {
    val code= ""

    intercept[ToolBoxError] {
      new ExternalScalaFileHelper().processExternalFile(code, file)
    }


  }
}

